INSERT INTO `post` (`id`, `user_id`, `category_id`, `title`, `slug`, `content`, `image`, `created_at`, `active`) VALUES
(1, 18, 2, 'Le meilleur surfeur', 'le-meilleur-serveur', 'C\'est de la bombe!', 'https://images.unsplash.com/photo-1502680390469-be75c86b636f?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8c3VyZnxlbnwwfHwwfHw%3D&w=1000&q=80', '2022-04-19 10:41:13', 0),
(2, 18, 2, 'Rencontre avec Lolita', 'rencontre-avec-lolita', 'Je m&rsquo;appelle Lolita, j&rsquo;habite &agrave; Biarritz et je tiens le blog Surf Madame depuis quelques ann&eacute;es sur lequel je partage ma passion pour le surf et les sports outdoor aupr&egrave;s d&rsquo;une communaut&eacute; incroyable de nanas qui n&rsquo;ont pas peur de se mouiller !<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Ou as tu grandi et comment es-tu arriv&eacute;e au pays basque ?</strong><br />\r\n<br />\r\nJ&rsquo;ai grandi en Normandie, loin de l&rsquo;oc&eacute;an. Vers mes 15 ans nous avons d&eacute;m&eacute;nag&eacute; sur la c&ocirc;te en Charente-Maritime, apr&egrave;s un petit tour &agrave; Bordeaux et aux Etats-Unis pour mes &eacute;tudes j&rsquo;ai atterri &agrave; Biarritz, d&rsquo;abord pour le travail mais aussi parce que cette r&eacute;gion entre oc&eacute;an et montagne me correspond parfaitement, je suis vraiment bien ici et pas pr&ecirc;te de repartir !<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Comment est la vie au pays basque ?</strong><br />\r\n<br />\r\nG&eacute;niale la plupart du temps, un peu compliqu&eacute;e en &eacute;t&eacute; ahah. Les hivers sont assez durs, il y a beaucoup de temp&ecirc;tes et il pleut beaucoup, mais on a la chance d&rsquo;avoir la montagne pas tr&egrave;s loin pour aller passer des week-ends dans la neige. Pour le reste de l&rsquo;ann&eacute;e la vie est douce, rythm&eacute;e par les sessions de surf et les ap&eacute;ros au sunset, et un peu de boulot entre les deux quand m&ecirc;me, on est pas en vacances toute l&rsquo;ann&eacute;e non plus, m&ecirc;me si parfois &ccedil;a y ressemble.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<blockquote>\r\n<p><em><strong>&nbsp;&raquo; il m&rsquo;arrive de quitter le bureau pour aller surfer quand les vagues sont tops &laquo;&nbsp;</strong></em></p>\r\n</blockquote>\r\n<img src=\"data:image/jpeg;base64,\"\r\n<p><br />\r\n<strong>Peux-tu nous d&eacute;crire ton quotidien ?</strong><br />\r\n<br />\r\nJe me l&egrave;ve assez t&ocirc;t en g&eacute;n&eacute;ral, quand il fait jour et que les conditions sont bien j&rsquo;essaie d&rsquo;aller surfer, sinon je vais &agrave; la salle de sport une petite heure avant le travail. Ensuite direction le bureau toute la journ&eacute;e ou je travaille &agrave; mon compte en communication digitale et je g&egrave;re mon blog en m&ecirc;me temps, quand j&rsquo;ai un peu de temps. J&rsquo;ai un emploi du temps assez flexible mais charg&eacute; finalement, il m&rsquo;arrive de quitter le bureau pour aller surfer quand les vagues sont tops, c&rsquo;est le gros avantage d&rsquo;&ecirc;tre &agrave; mon compte.</p>', 'https://www.lagreensession.com/wp-content/uploads/2019/02/photo-lolita-surf-madame-surf-3.jpg', '2022-04-19 11:47:46', 0),
(3, 18, 3, 'Top des activités à faire cet hiver', 'top-des-activites-a-faire-cet-hiver', 'Cocorico, la France fait partie des destinations favorites pour profiter d\'un agréable séjour de ski ! Le pays compte pas moins de 350 stations de ski toutes aussi attrayantes les unes que les autres. Certaines combinent même domaine skiable alpin et nordique pour alterner entre ski de piste, ski de fond et même ski de rando. Les plus importantes se trouvent dans les alpes avec des stations comme par exemple Courchevel, Megève, Méribel, Val d\'Isère et bien d\'autres. Si vous préférez partir à l\'étranger, nos voisins alpins comme l\'Italie, la Suisse ou l\'Autriche ne sont pas en reste en arborant des stations de haute altitude parfois même accessibles l\'été. Pour carrément changer, traverser l\'Atlantique et direction l\'Amérique du Nord pour la maxi station Aspen aux États-Unis ou à Lake Louise au Canada et ses 145 pistes de ski. Côté Japon, on trouve également des domaines magnifiques avec des paysages uniques au monde complètement différents de nos montagnes européennes. Avec cet embarras du choix, plus aucune excuse pour ne pas skier cet hiver !\r\n\r\n ', 'https://img.ev.mu/images/articles/600x/994732.jpg', '2022-04-19 13:18:50', 0);

